style.css:
.tv-lightweight-charts {
  position: relative;
  background-image: url("https://s1.zerochan.net/Souryuu.Asuka.Langley.600.448646.jpg") !important;
  background-size: cover;
}

.tv-lightweight-charts::before {
  content: "";
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  background-color: rgba(0, 0, 0, 0.5);
}

